import 'package:stock_variation_module/src/external/datasources/stock_variation_datasource_impl.dart';

import 'stock_variation_datasource_impl_test.mocks.dart';

@GenerateMocks([http.Client])
void main() {
  final client = MockClient();
  final datasource = StockVariationDatasourceImpl(client: client);
  test('deve retornar um Future<StockVariationModel>', () async {
    const uri = 'https://query2.finance.yahoo.com/v8/finance/chart/PETR4.SA';
    when(client.get(Uri.parse(uri)))
        .thenAnswer((_) => Future.value(http.Response(body, 200)));

    final future = datasource.getStockVariationV8(stock: "PETR4");
    expect(future, completes);
  });
}

